import React from "react";

export const FlowersDialog = () => {
  return (
    <dialog open>
      <h2>This is portfolio page</h2>
      <div>
        If you enjoed by this page, please, contact with me on{" "}
        <a href="https://www.linkedin.com/in/karanelus/">LinkedIn</a>. I'm will
        be happy to{" "}
      </div>
      <form method="dialog">
        <button>OK</button>
      </form>
    </dialog>
  );
};
